        <div className="form-control">
          <label htmlFor="text"> text </label>
          <input type="text" placeholder="Enter text...." />{" "}
        </div>

        <div className=" form-control">
          <label htmlFor="amount"> Amount </label> <input> </input>
        </div>
      </form>
    </>
  );
};

export default Addtransection;
